import './App.css';
import curriculums from './data/curriculums';
import disciplines from './data/disciplines';
import estimates from './data/estimates';

import curriculumsList from './components/curriculumsList/curriculumsList';

function App() {

  return (
      <curriculumsList curriculums = {curriculums} 
                       disciplines = {disciplines}
                       estimates = {estimates} />
  );
}

export default App;
